  false,\n\t\"url\": null,\n\t\"notes\": \"The Texas Automated Buoy System contains
  daily oceanographic measurements from seven buoys off the Texas coast from Brownsville
  to Sabine. The Texas General Land Office supports this system as part of its mission
  to mitigate the effect of catastrophic oil spills on the Texas Coast. Buoys communicate
  surface currents and water temperature measured at 2m depths in near real time via
  cell phone and commercial satellite digital data links. Data are available within
  a few hours of collection, but gaps in the data may occur.\",\n\t\"owner_org\":
